import React from 'react';
import styled from 'styled-components';

import { NavLink } from 'react-router-dom';
import {Div, Input, Button} from '../styles/DefaultStyles';



const DivCreatingPlan = styled(Div)`
  grid-area: add;
  height:100%;

  display: flex;
  flex-direction: column;
  justify-content: space-evenly;
  align-items: center;
`;


const DivHeader = styled(Div)`
  display: flex;
  flex-direction: column;
  justify-content: flex-start;
  align-items: center;
`

const DivTitle = styled(Div)`
  font-size: 1.6rem;
`
const DivId = styled(Div)`
  color: ${props => props.theme.color_weak};
`


const DivBody = styled(Div)`
	display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;

  & > * {
  	margin-left: 5px;
  	margin-right: 5px;
  }
`

const DivInput = styled(Div)`
	width: 120px;

	height: 90px;
	display: flex;
  flex-direction: column;
  justify-content: space-evenly;
  align-items: center;
`

const InputPw = styled(Input)`


`

const InputBattletag = styled(Input)`


`

const ButtonAddFirst = styled(Button)`
  width: 80px;
`




 const CreatingPlan = () => {



  return (

  <DivCreatingPlan>

    <DivHeader>
      <DivTitle> Team Generator </DivTitle>

      <DivId> add battletag first to create plan</DivId>
    </DivHeader>


    <DivBody>

	    <DivInput>
	      <InputPw placeholder="sharing-password" />
	      <InputPw placeholder="shared-password again" />
	      <InputBattletag placeholder="battletag#1234" />
	    </DivInput>

	     <ButtonAddFirst> Create Plan </ButtonAddFirst>

    </DivBody>

  </DivCreatingPlan>

  )

}



export default CreatingPlan;
